import React from 'react';
import NFTCard from './NFTCard.jsx'

function Gallery(props) {

    return (
        props.nftList.map((nft)=> {
            console.log(nft);
            <NFTCard imgURL={nft.media[0].gateway}></NFTCard>
        })

    );
}
export default Gallery;
